# Complete the highestValuePalindrome function below.
def highestValuePalindrome(s, n, k):
    # Solution correct but not performant enough
    # Using two while loops and a new string object is the solution
    # 1. create new string and make a palindrom out of it with minimal costs 
    #    using two pointer at the beginning and end of the string
    # 2. start from i=0 and j=n-1 setting value to '9' where palindrom has no '9'
    #    substract only -1 if you already modified the result string in that position
    #    The modification can be found by comparing the new result string and the old 
    #    input string
    # see HeighestValuePalindrome.cpp in cpp-test
    return str(highestValuePalindromeInternal(s, 0, k))
    

def highestValuePalindromeInternal(s, i, k):
    if k<0:
        return -1
    if k>=0 and i > len(s)//2:
        return int(s)
    
    result = -1
    j = len(s)-1-i
    if s[i]==s[j]:
        result = max(result, highestValuePalindromeInternal(s,i+1,k))
    else:
        new_string = list(s)
        highest_value = max(int(s[i]), int(s[j]))
        new_string[i] = str(highest_value)
        new_string[j] = str(highest_value)
        result = max(result, highestValuePalindromeInternal(''.join(new_string), i+1, k-1))
    if s[i] != '9' or s[j] != '9':
        costs = 0
        if s[i] != '9': 
            costs+=1
        if s[j] != '9' and i != j: 
            costs+=1
        new_string = list(s)
        new_string[i] = '9'
        new_string[j] = '9'
        result = max(result, highestValuePalindromeInternal(''.join(new_string), i+1, k-costs))
    return result

